    false,nt"url": null,nt"notes": "The RGB/CIR half-foot orthophotos to be
    mapped consists of 2,258 cells (approximately 2,025 square miles) flown with a Z/I
    Intergraph DMC airborne digital sensor. The flight season was from December 15,
    2007 through March 15, 2008. The flight dates are as follows: December 19, 2007;
    January 3, 2008 (two lifts); January 4, 2008; January 5, 2008; January 6, 2008;
    January 7, 2008; January 8, 2008; January 9, 2008. All images were collected between
    10:00 AM to 2:30 PM to minimize shadows. All images were obtained under cloud free
